import './index.css';



function arr2obj(arr) {

  let obj = [];

  arr.forEach(v => {

    let key = v[0];
    let value = v[3];

    obj[key] = value;
  });
return obj;
}
console.log(

  arr2obj([

    ["Joe", 12, "Joe"],
    ["Jack", 13, "Like"],
    ["Matt", 14, "Tea"],

  ])
)
